window.bookSummaryJSON = "<p>Hooray for Hollywood? The saucy sleuth Sammy Keyes discovers otherwise in this spirited mystery.</p> <p>When Sammy's mother dumped her with Grams to go to Hollywood and become a star, Sammy dealt with it. But when she discovers that Lady Lana has changed her name, dyed her hair, and shaved 10 years off her age, Sammy hops a bus to Hollywood and finds her mom in deeper trouble than she expected. One of Lana's biggest competitors is found dead in the room next door. Is Sammy's mother the next victim...or the prime suspect?</p>"; 
